import React from 'react'

    const Contacts = ({ contacts }) => {
      return (
        <div>
          <h1>Contact List</h1>
          {contacts.map((contact) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{contact[0]}</h5>
              </div>
            </div>
          ))}
        </div>
      )
    };

    export default Contacts
